  03> MACKAY, Rachel Jane
  b 20.08.1954
  01> MACKAY, Denis Handcock m on 23.07.1976 to (2)BIGGS, Clare Mignon
  b 19.03.1916
  b 21.09.1926 d 09.03.1996
  Address: 2/905 Gordon Road, Hastings.
  02> MACKAY, Colin Keith m on 03.11.1948 to HARLEY, Jeannette Constance Kerr
  b 28.03.1918
  b 20.04.1923
  Colin b. at Lower Moutere and m. at Christ Church Cathedral, Nelson. Jeannette, d/o Howard CK Harley
  and Winifred Isobel Paradise. Address: 101 Aranui Road, Mapua, Nelson.
  Colin studied engineering. He served in the armed forces in WW2 and was a prisoner of war in Italy and
  Austria. He was then an orchardist in Lower Moutere until about 1971 when he retired to Mapua for
  health reasons. Jeanette trained in opera singing in Sydney and later became a full-time school
  teacher.
  01> MACKAY, Timothy John m on 18.04.1981 to PATTERSON, Katharine Linda
  Holmes (Kate)
  b 19.05.1950
  b 14.09.1953
  Timothy b. at Nelson and m, at Blenheim. Katharine, d/o Dr Kenneth Hardie Patterson and Joan
  Margaret Holmes, b. at Blenheim. 196 Nile Street E, Nelson.
  Tim attended Hereworth School (1960-62) and Nelson College (1963-67). He worked on his father's
  orchard before entering radio in 1968. He lived in England (1975-80) then worked in radio in
  Greymouth, Timaru and Invercargill before moving to Wellington in 1989. He was Creative Director
  on 2ZB in Wellington before moving back to Nelson in 1996 where he is now working in tourism
  consultancy. Kate was formerly a secondary school teacher in Auckland and now works for a
  Norwegian company in Richmond.
  01> MACKAY, Lisa Katharine
  b 06.11.1984
  Lisa b. at Timaru.
  02> MACKAY, Stephanie Mariele
  b 22.04.1987
