  02> MACKAY, Penelope Christine and STARNES, Colin Keith
  b 22.07.1953
  b 20.10.1953
  Penelope b. at Nelson. Colin, s/o Tom and Isobel Starnes. Address: 35 Rainbow Drive, Nelson.
  Penelope is a part time commercial pilot and flying instructor and Colin is a tutor at the Commerce
  Department of the Nelson Polytechnic. Both are interested in sailing and diving.
